import Exemple3 from './components/exemple/Exemple3';
import Exemple4 from './components/exemple/Exemple4';
import Header from './components/layout/Header';

function App() {
  return (
    <div className="App">
        <Header></Header>
        <Exemple1></Exemple1>
        <Exemple2></Exemple2>
        <Exemple3></Exemple3>
        <Exemple4></Exemple4>
    </div>
  );
}

export default App;
